import React from 'react';
import styled from 'styled-components';

const HomeWrapper = styled.div`
  background: url("./images/bg.jpg") no-repeat center / cover;
  width: 100%;
  height: 100%;
`;

const Home = () => {
  return (
    <HomeWrapper>
    </HomeWrapper>
  );
};

export default Home;
